import React from 'react';

const Footer = () => {
	return (
			<div className='footer'>
				<div className="container">
					<div className="footer__inner">
						<ul className='footer__list'>
							<li className="footer__item">
								<a href="#" className="footer__link">

								</a>
							</li>
						</ul>
					</div>
				</div>
			</div>
	);
};

export default Footer;
